    console.log(password)
     console.log(lastName)
      console.log(firstName)
       console.log(email)
    const user = {
      firstName: firstName,
      lastName: lastName,
      email: email,
      password: password,
    };
    console.log(user)
    axios
       .post("http://localhost:7000/signup", user)
 .then((res) => {
    console.log(res.data);
    if(res.data === "User authenticated"){
        alert('User authenticated')
      }
  }).catch((error) => {
       alert("try again ")
      console.log(error)
  });
  };
